package data

import (
	"bytes"
	"compress/gzip"
	"encoding/hex"
	"io"
)

var dataHex = ""

// Hm tr v io.ReadSeeker t chui d liu []byte
func GetReaderFromData() io.ReadSeeker {

	// Gii nn d liu
	dataCompressed, err := hex.DecodeString(dataHex)
	if err != nil {
		panic(err)
	}
	buf := bytes.NewBuffer(dataCompressed)
	zr, err := gzip.NewReader(buf)
	if err != nil {
		panic(err)
	}

	// c d liu sau khi gii nn
	var result bytes.Buffer
	_, err = io.Copy(&result, zr)
	if err != nil {
		panic(err)
	}
	err = zr.Close()
	if err != nil {
		panic(err)
	}

	return bytes.NewReader(result.Bytes())
}
